import {Link} from 'react-router-dom'
import "./Login.css";
const Login = () => {
  return (
    <>
      <div className="login">
      <span className="login-title">Login</span>
        <form className="login-form">
        <label>Email</label>
        <input className="login-input" type="email" placeholder="Enter your email..." />
        <label>Password</label>
        <input className="login-input" type="password" placeholder="Enter your password..." />
        <div className="btn"><button className="login-btn">Login</button>
        <button className="signup-btn"><Link className="link" to="/signup">Signup</Link></button></div>
        </form>

      </div>
    </>
  );
};
export default Login;
